INSERT INTO `pe_behaviors` (`id`, `objective`, `description`, `bobot`, `priode`, `level`, `created_at`, `updated_at`)
VALUES
	(1,'Kreatif dan Inovasi','Memberikan ide, inovasi terkait lingkup pekerjaan dalam departemen',5,'Semester','s','2024-05-29 04:35:45','2024-05-29 04:35:45'),
	(2,'Kerjasama','kemampuan untuk melakukan koordinasi dan komunikasi dengan berbagai pihak yang terkait;  merumuskan tujuan bersama dan berbagi tugas untuk mencapai sasaran kerja yang telah ditetapkan; serta saling menghargai pendapat dan masukan guna peningkatan kinerja tim',5,'Semester','s','2024-05-29 04:35:45','2024-05-29 04:35:45'),
	(3,'Inisiatif','kemampuan untuk menjalankan inisiatif perbaikan mutu kerja tanpa harus diperintah; bersikap proaktif dan memiliki self-motivation yang tinggi untuk menuntaskan pekerjaan; serta mampu dalam mengajukan usulan/masukan untuk peningkatan mutu kerja',5,'Semester','s','2024-05-29 04:35:45','2024-05-29 04:35:45'),
	(4,'Leadership','Kemampuan untuk menetapkan dan mengkomunikasikan sasaran kerja tim, mengelola dan membagi sumber daya tim secara efektif; serta melakukan monitoring dan mengarahkan agar sasaran kinerja tim dapat tercapai secara optimal',5,'Semester','l','2024-05-29 04:35:45','2024-05-29 04:35:45'),
	(5,'Perencanaan Kerja','Kemampuan untuk menyusun rencana kerja secara sistematis dan terjadwal dengan baik; melakukan alokasi sumber daya berdasarkan hasil perencanaan; serta melakukan monitoring untuk memastikan rencana kerja dapat berjalan dengan efektif',5,'Semester','l','2024-05-29 04:35:45','2024-05-29 04:35:45'),
	(6,'Komunikasi','Kemampuan untuk mengutarakan pikirannya (baik secara lisan ataupun tertulis) dalam bahasa yang sistematis, jelas dan mudah dipahami oleh lawan bicara. Mampu menerima dan merespon pembicaraan dari pihak lain dengan baik',5,'Semester','l','2024-05-29 04:35:46','2024-05-29 04:35:46'),
	(7,'Kemampuan Memecahkan Masalah','Kemampuan untuk menganalisa masalah, mengidentifikasi sumber penyebab masalah dan merumuskan alternatif solusi yang relevan dan aplicable',5,'Semester','l','2024-05-29 04:35:46','2024-05-29 04:35:46');
